import React,{Component} from 'react';
import { Link } from 'react-router-dom';

class AssetEditor extends Component{
  constructor(props){
      super(props)
    //  this.asset=this.props.route.asset;
      // this.state = {
      //   nid:null
      // }
      //
      // this.handleOpen = this.handleOpen.bind(this)
    }
    // handleOpen(result){
    //   console.log(result);
    //   this.setState({
    //     nid:result
    //   })
    // }
    render(){
      return(
        <div className="container">
          <div className="row row-header">
            <div className="col-lg">
              Respirador Drager
            </div>
            <div className="col-lg">
              En servicio
            </div>
          </div>
          <div className="row" style={{textAlign:'center',marginTop:'20px'}}>
            <div className="col-lg">

              <div className="form-group">
                <input type="text" className="form-control" placeholder="Modelo"/>
              </div>
              <div className="form-group">
                SN: 123456
              </div>
              <div className="form-group">
                ID 1: 123456
              </div>
              <div className="form-group">
                <input type="text" className="form-control" placeholder="ID 2"/>
              </div>
              <div className="form-group">
                <input type="text" className="form-control" placeholder="ID 3"/>
              </div>
              <div className="form-group" >
                <input type="text" className="form-control" placeholder="Fin de Garantía"/>
              </div>
              <div className="form-group">
                <input type="text" className="form-control" placeholder="Proximo MP"/>
              </div>
              <div className="form-group">
                <input type="text" className="form-control" placeholder="Antiguedad"/>
              </div>
              <div className="form-group">
                <input type="text" className="form-control" placeholder="Propiedad"/>
              </div>
            </div>
          </div>

          <div className="row" style={{marginTop:'20px'}}>
            <div className="col-md-4" style={{textAlign:'center'}}>
              <Link to="/"><button type="button" className="btn btn-outline-primary btn-lg btn-full">Solicitar MC</button></Link>
            </div>
            <div className="col-md-4" style={{textAlign:'center',marginTop:'20px'}}>
              <Link to="/"><button type="button" className="btn btn-outline-warning btn-lg btn-full" >Historial</button></Link>
            </div>
            <div className="col-md-4" style={{textAlign:'center',marginTop:'20px'}}>
              <Link to="/qr"><button type="button" className="btn btn-outline-secondary btn-lg btn-full">Regresar</button></Link>
            </div>
          </div>
        </div>
      )
    }
}

export default AssetEditor;

